import React from 'react';
import classes from "./dialogs.module.css";
import {NavLink} from "react-router-dom";
import Message from "../chat/message/message";
const Name =(props)=>
{
    return(
        <div className={classes.userName}>
            <NavLink  activeClassName={classes.active} to={"/dialog/" + props.id} >{props.name}</NavLink>
        </div>
    );
}
const Chat = (props)=>
{
    return(
        <div className={classes.pole}>

            <Message text={props.sms}/>
        </div>
    );
}

const Dialogs = (props) =>
{
    let dialogsData = [
        {id:1, name:'Ivan'},
        {id:2, name:'Dima'},
        {id:3, name:'Gromik'}
        ];
    return(
        <div className={classes.content}>
            <div className={classes.dialogs}>
                <Name name={dialogsData[0].name} id={dialogsData[0].id}/>
                <Name name={dialogsData[1].name} id={dialogsData[1].id}/>
                <Name name={dialogsData[2].name} id={dialogsData[2].id}/>
            </div>
            <Chat sms='Idi v fdfjlsdfds'/>
        </div>
    );
}
export default Dialogs;
